import React, { useEffect, useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";


function HomePage() {
  const [darkMode, setDarkMode] = useState(false);

  const toggleDarkMode = () => {
    document.body.classList.toggle("dark-mode");
    setDarkMode(!darkMode);
  };

  useEffect(() => {
    const handleScroll = () => {
      const sections = document.querySelectorAll(
        ".features-section, .how-it-works-section, .use-cases-section, .faq-section, .contact-section"
      );
      sections.forEach((section) => {
        const rect = section.getBoundingClientRect();
        if (rect.top < window.innerHeight - 100) {
          section.classList.add("section-visible");
        }
      });
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  const toggleAnswer = (e) => {
    const answer = e.currentTarget.nextElementSibling;
    const arrow = e.currentTarget.querySelector(".arrow");
    if (answer.style.display === "block") {
      answer.style.display = "none";
      arrow.style.transform = "rotate(0deg)";
    } else {
      answer.style.display = "block";
      arrow.style.transform = "rotate(180deg)";
    }
  };

  return (
    <>
      <header className="hero-section bg-primary text-white">
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
          <div className="container">
            <a className="navbar-brand fw-bold" href="#">HoneSta</a>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav ms-auto">
                <li className="nav-item">
                  <a className="nav-link" href="#features">Features</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#how-it-works">How It Works</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#use-cases">Use Cases</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#faq">FAQs</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#contact">Contact</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link btn btn-outline-light ms-2" href="/login">Login</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link btn btn-warning text-dark ms-2" href="/register">Sign Up</a>
                </li>
              </ul>
            </div>
          </div>
        </nav>
        <div className="container text-center py-5">
          <h1 className="display-4 fw-bold">Integrity in Every Click, Confidence in Every Step.</h1>
          <p className="lead">A scalable, privacy-focused proctoring system designed for all institutions.</p>
          <div className="mt-4">
            <button onClick={toggleDarkMode} className="btn btn-light me-2">
              {darkMode ? "Switch to Light Mode" : "Switch to Dark Mode"}
            </button>
          </div>
        </div>
      </header>

      <section id="features" className="features-section py-5 bg-light">
        <div className="container">
          <h2 className="text-center mb-5">Key Features</h2>
          <div className="row gy-4">
            <div className="col-md-6 col-lg-3">
              <div className="card shadow">
                <img src="behavioral-monitoring.jpg" className="card-img-top" alt="Behavioral Monitoring" />
                <div className="card-body text-center">
                  <h5 className="card-title">Behavioral Monitoring</h5>
                  <p className="card-text">Detect suspicious activities through mouse movements, keystrokes, and window shifts.</p>
                </div>
              </div>
            </div>
            <div className="col-md-6 col-lg-3">
              <div className="card shadow">
                <img src="dynamic-risk-scoring.jpg" className="card-img-top" alt="Dynamic Risk Scoring" />
                <div className="card-body text-center">
                  <h5 className="card-title">Dynamic Risk Scoring</h5>
                  <p className="card-text">Real-time analytics calculate and adjust risk scores based on user behavior.</p>
                </div>
              </div>
            </div>
            <div className="col-md-6 col-lg-3">
              <div className="card shadow">
                <img src="privacy-compliance.jpg" className="card-img-top" alt="Privacy Compliance" />
                <div className="card-body text-center">
                  <h5 className="card-title">Privacy-First Design</h5>
                  <p className="card-text">GDPR and FERPA compliant—ensures no video or audio invasion during assessments.</p>
                </div>
              </div>
            </div>
            <div className="col-md-6 col-lg-3">
              <div className="card shadow">
                <img src="automated-alerts.jpg" className="card-img-top" alt="Automated Alerts" />
                <div className="card-body text-center">
                  <h5 className="card-title">Automated Alerts</h5>
                  <p className="card-text">Proactive notifications ensure timely interventions during flagged activities.</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Additional sections styled similarly */}
    </>
  );
}

export default HomePage;
